scriptlet.script:
try {
	var rid = resourceidentityid;
	var ip = ipAddress;
	var host = hostName;
	var ipamResources = ipamResources;

	var rt = (ipamResources != null && ipamResources != undefined && ipamResources.trim() != "")? JSON.parse(ipamResources): [];
	var item = {};
	item.ipAddress = ip;
	item.hostName = host;
	item.resourceId = rid;
	rt.push(item);
	scriptletContext.put("ipamResources",JSON.stringify(rt)); 
	scriptletResponse = "success";
}
catch(Error) {
	scriptletContext.put("FailureMessage",Error);
	scriptletResponse = "failure";
}
